import { useLocation } from 'react-router-dom';

const RunningSessionPage = () => {

  const { state } = useParams();
  const { ws } = state;

  useEffect(() => {
    // Use ws connection
    console.log('WebSocket connection:', ws);
  }, [ws]);

  return (
    <div >
      <p>You are at the game screen =</p>
    </div>
  );
};

export default RunningSessionPage;
